        jLabel25.setText("This application is very easy to use. The major requirement of this application is that your datasets follow a naming scheme as follows:");

        jLabel26.setText("A text file containing profits ( \"name\"_p.txt), e.g.   p01_p.txt, if the name of the dataset is P01");

        jLabel27.setText("A text file containing weights ( \"name\"_w.txt), e.g.   p03_w.txt , if the name of the dataset is P03");

        jLabel28.setText("A text file containing capacity ( \"name\"_p.txt), e.g.   p02_p.txt, if the name of the dataset is P02");

        jLabel29.setText("In a general 0-1 Knapsack problem, there are three variables that we deal with to find an optimal solution. These are weight of an item, the");

        jLabel30.setText("profit value of that item, and the maximum capacity of the Knapsack that we are trying to fully pack without losing value. ");

        jLabel31.setText("your weights TXT file should contain integers, with each weight values in a seperate (one item's weight per line). It is mandatory that ");

        jLabel32.setText("Your profits TXT file should contain integers, with each profit values in a seperate (one item's profit per line). The same also goes with");

        jLabel33.setText("your profits TXT file and weights TXT file should contain the same amount of lines, i.e. both having the same no. of items to map their");

        jLabel34.setText("respective profit and weight values. After this, your capacity TXT file (with suffix:  _c.txt )  should have a single entry as an integer, ");

        jLabel35.setText("indicating the maximum capacity of the Knapsack. ");

