        jLabel54.setText("You have reached the end of \"Our findings\"  documentation");

        jLabel55.setText("Drawing graphs in paper is easy. In computers? Well if using an already existing app or program, it seems easy too. But making  ");

        jLabel56.setText("our own methods of drawing graphs using Java code has introduced us with a lot of challenges and obstacles. Thanks to the ");

        jLabel118.setText("We see that dynamic programming works well for small Knapsack problems, whereas the Genetic Algorithm (GA)  might ");

        jLabel119.setText("work faster and more effecient if the scale of the Knapsack problem is larger, especially when the parameter for  ");

        jLabel120.setText("the Knapsack capacity (in our case = W) is very large. In this case, the Genetic Algorithm has a better space complexity ");

        jLabel121.setText("since it consumes way less memory than a Dynamic Programming (DP)  approach whenever the scale of the Knapsack problem ");

        jLabel122.setText("grows. In small datasets like P01, P02, P03, P04, P05, P06, and P07 the DP might perform better than GA. The big difference comes ");

        jLabel123.setText("when the dataset P08 is evaluated where the GA seems to find the solution much more efficient and quicker with NFC way less than ");

        jLabel124.setText("the DP, and also significantly less memory, considering the size of the 2D array that DP uses to solve the Knapsack problem. ");

        jLabel125.setText("The 2D array in concern here is the V[n][W] array (or P[i][W] depending on your implementation of DP). Notice the size of W  ");

        jLabel126.setText("in the P08 dataset, it is too big. Luckily for us, we were able to run the single test in Q1&Q2, and the empirical test in Q3, however ");

        jLabel127.setText("the size of the 2D array and the NFC's really pushes our Graph Plotter function to the limits as the DP data exceeds the JVM  ");

        jLabel128.setText("memory limits. For datasets P01 to P07, you can still play around with our graph plotter in the Q4.Race tab. ");

        jLabel129.setText("We were able to use the benchmark datasets, and surprisingly our GA was able to find the solutions for all *datasets. The DP as ");

        jLabel130.setText("expected does the same too as it is a deterministic algorithm. If our Knapsack problem can work with these datasets, then it ");

        jLabel131.setText("should also work with other datasets out there. ");

        jLabel132.setText("The DP has a 100% success rate (SR), while the the GA has mixed results, but we guarantee that the success rates for all datasets ");

        jLabel133.setText("from P01 to P08, the GA produces a non-zero success rate with the best being 100% SR in small datasets like P01, P02, P03, P05 ");

        jLabel134.setText("and P06, while dataset P04 produces an SR of 90%, P07 producing an SR of 54% and P08 produces an SR of 19%. ");

        jLabel135.setText("The GA again as we see, solves the knapsack problem in P08 datasets much faster. Here are some ways we found the best, mean,  ");

        jLabel136.setText("\"org.knowm.xchart\" libraries, we were able to use Java code to plot graphs natively, and the results really amazes. We are still ");

        jLabel137.setText("experimenting alot with this library, and it seems there is a lot to learn when it comes to Java programming and generally ");

        jLabel139.setText("and max NFC's. ");

        jLabel140.setText("- Best NFC: Both algorithms happen to continue their operations despite reaching an optimal solution, hence we store the best NFC  ");

        jLabel141.setText("somewhere and keep it aside, as soon as the fitness value or maximum profit is reached. ");

        jLabel142.setText("- Mean NFC: The average NFC");

        jLabel143.setText("- Max NFC: This is usually the NFC at the end of the operations for GA and DP. ");

        jLabel138.setText("application development or software engineering. ");

